INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(187442, 'ruRU', '', 'Грехов у тебя хватает. Но травить невинных зверями – особенно жестоко.', 37474),
(38124, 'ruRU', 'Ступай во тьму... в вечную тьму.', 'Ступай во тьму... в вечную тьму.', 37474),
(180366, 'ruRU', '', 'Рада приветствовать тебя в Бастионе! Странно... такой души, как ты, я еще не видела. Впрочем, неважно.', 37474),
(187280, 'ruRU', 'Дом Глаз уничтожен, и теперь наши тайны в безопасности. Больше никто не сможет нам помешать.', '', 37474),
(185904, 'ruRU', 'Брось. Я был лучше его во всем!', '', 37474),
(182733, 'ruRU', 'Знак мудрости. Путеводная звезда среди невежества и страха.', '', 37474),
(180367, 'ruRU', '', 'Уже скоро тебе предстоит стать кирией! Наш священный долг – приводить души из мира смертных на суд к Арбитру.', 37474),
(194383, 'ruRU', '', 'Это будет интересно.', 37474),
(182626, 'ruRU', '', 'Когда приготовишься, подойди к огню и следуй указаниям.', 37474),
(202313, 'ruRU', '', 'Позволь пронзить их! Порубить! Заколоть! Покромсать! Порезать на лоскуты...', 37474),
(202311, 'ruRU', 'А это мысль... Мы можем выпотрошить этих мелких, слабодушных существ и приблизиться к нашей великой цели, растоптав их кости. Что же выбрать...', '', 37474),
(202310, 'ruRU', '', 'У меня идея получше, Владыка! Давай я их покромсаю!', 37474),
(202312, 'ruRU', '', 'Владыка, ну пожа-а-алуйста! Я так давно не резала живую плоть!', 37474),
(202315, 'ruRU', 'Я помогу нашим гостям познать искупление. А когда они покаются, я разрешу тебе растерзать их тела и отправить их вопящие души в Утробу.', '', 37474),
(205464, 'ruRU', '', 'Теперь я вижу, почему существа из твоего мира считаются могучими противниками. Неудивительно, что вам удалось прогнать Пылающий Легион. От лица Арденвельда благодарю тебя за эту силу.', 37474),
(191962, 'ruRU', '<В основании статуи вырезана надпись.>\n\nУважение надо заслужить, доказав свою силу. Мы чтим тех, кто возвысился над всеми прочими.', '', 37474),
(191966, 'ruRU', '<На постаменте вырезана надпись.>\n\nИногда истина скрывается во тьме. Умелые шпионы таятся в тени и остаются незаметными.', '', 37474),
(180775, 'ruRU', 'Скажи... дроману...', 'Скажи... дроману...', 37474),
(193577, 'ruRU', '', 'Держите-ка вот это.', 37474),
(186290, 'ruRU', 'Красиво и мощно. Корона, которая защитит мир.', '', 37474),
(193598, 'ruRU', '', 'Куда бы вас переместить?', 37474),
(193582, 'ruRU', '', 'А как вам это?', 37474),
(203409, 'ruRU', 'В пламени Торгаста куется оружие... рунический клинок.', '', 37474),
(196707, 'ruRU', 'Огонь по готовности!', '', 37474),
(199409, 'ruRU', 'А почему древние тирненны не могут это сделать?', '', 37474),
(199444, 'ruRU', 'Вот так. Покончим с этим!', '', 37474),
(198956, 'ruRU', 'У меня нет на это времени, |3-6($c). Графиня ждет.', 'У меня нет на это времени, |3-6($c). Графиня ждет.', 37474),
(206412, 'ruRU', '', 'Что привело тебя в Малдраксус, $p?\n\nХочешь собрать грибы для своего пиршества или нанять малдраксийских солдат, чтобы защитить своих гостей?\n\n<Баронесса Вайш улыбается.>\n\nДолжна признаться, я не ожидала, что мне так понравится на твоих приемах.\n\nКонечно, принц Ренатал неплохо играет роль хозяина на главной сцене, но я не могла отвести глаз от тебя.\n\nТы распоряжаешься всем за кулисами так же, как приходилось мне, когда я служила при дворе королевы.\n\n<На мгновение взор леди Вайш устремляется вдаль.>\n\nЭто очень тяжелый труд.', 37474),
(202361, 'ruRU', 'Кирия! Добро пожаловать в Вечные архивы. Прилив анимы позволит нам усилить твои способности.\n\nМое усиление дарует тебе способность:\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[Путеводная звезда перерожденного]|h|r: когда уровень здоровья составляет выше 90%, наносящие урон заклинания и способности могут применить к цели \"Отметку для сбора\", наносящую периодический урон. Если вы убьете цель во время действия этого эффекта, полученная от нее анима на некоторое время укроет вас щитом.', 'Кирия! Добро пожаловать в Вечные архивы. Прилив анимы позволит нам усилить твои способности.\n\nМое усиление дарует тебе способность:\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[Путеводная звезда перерожденного]|h|r: когда уровень здоровья составляет выше 90%, наносящие урон заклинания и способности могут применить к цели \"Отметку для сбора\", наносящую периодический урон. Если вы убьете цель во время действия этого эффекта, полученная от нее анима на некоторое время укроет вас щитом.', 37474),
(199451, 'ruRU', '', 'Ха... Как-то раз, когда Творец Снов...', 37474),
(183994, 'ruRU', '', 'Чуть влево!', 37474),
(183995, 'ruRU', '', 'Влево! Вправо! Не туда!', 37474),
(183993, 'ruRU', 'Можешь дотянуться?', '', 37474),
(204708, 'ruRU', 'Мертвая Савраска послушно поднимает копыта, позволяя вам заняться ее больными ногами. Она тяжело дышит, с шумом втягивая воздух. Кажется, она очень хочет пить.', '', 37474),
(204686, 'ruRU', 'Мертвая Савраска вздрагивает и тыкается в вас носом, когда щетка для груминга успокаивает ее зудящую шкуру. Когда она переносит свой вес с ноги на ногу и бьет копытом, вы видите, что ее подковы сильно выщерблены.', '', 37474),
(204663, 'ruRU', 'Мертвая Савраска начинает жадно поедать овес. Хотя в некоторых местах на ее шкуре остались клоки шерсти, на ней повсеместно видны укусы клещей, следы острых шипов и покраснения от вонючей грязи.', '', 37474),
(204710, 'ruRU', 'Мертвая Савраска стоит смирно, пока вы надеваете на нее чепрак. Ее дрожь затихает, а затем прекращается вовсе, и Савраска начинает рыться в ваших сумках, ища угощение.', '', 37474),
(204668, 'ruRU', 'Мертвая Савраска резко останавливается, чтобы вас не затоптать.', '', 37474),
(204903, 'ruRU', 'Мертвая Савраска смотрит на вас обезумевшими глазами. Она выглядит больной и истощенной. Ей явно нужно хорошенько поесть.', '', 37474),
(121956, 'ruRU', 'Я, мастер Матиас Шоу, даю Красным Клинкам разрешение устранить агента Эмбер Кирнен.', '', 37474),
(204709, 'ruRU', 'Мертвая Савраска жадно выпивает целое ведро, а затем тычется в вас лбом. Она утолила свою жажду, но продолжает дрожать.', '', 37474),
(54130, 'ruRU', '', 'Релл... тяжело ранен.$B$B<Агент Кирнен со злостью бьет кулаком по земле.>$B$BОн умирает, $n! И мы не в силах ему помочь!', 37474),
(204749, 'ruRU', 'Мертвая Савраска раздувает ноздри, почуяв яблоки. Она с удовольствием хрустит ими. Мертвая Савраска вздыхает с облегчением и кладет голову вам на плечо.', '', 37474),
(121283, 'ruRU', 'Кирнен была одной из нас. А мы ее убили… Поверить не могу.', '', 37474),
(197546, 'ruRU', '', 'Довольно! На ваши судороги больно смотреть.', 37474),
(207303, 'ruRU', 'Хорошо, что ты помогаешь нам защищать лес, $Gохотник:охотница;.', 'Хорошо, что ты помогаешь нам защищать лес, $Gохотник:охотница;.', 37474),
(189107, 'ruRU', 'Даже при недостатке компетентных заклинателей мы не собираемся брать кого попало.', '', 37474);
INSERT INTO `faction_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2463, 'ruRU', 'Чесночник', 'Чесночник – невообразимо древнее, похожее на гриб существо, живущее в Арденвельде и составляющее важную часть экосистемы этого мира. Ваша готовность помочь тронула то, что заменяет ему сердце, и у него для вас найдется еще много работы.', 37474),
(2410, 'ruRU', 'Неумирающая армия', 'Давным-давно Примас основал пять домов Малдраксуса, чтобы создать непобедимую армию. Сила, хитрость и ум этих непреклонных бойцов и заклинателей защищают Темные Земли от всех угроз.', 37474),
(2465, 'ruRU', 'Дикая Охота', 'Королева Зимы призывает Дикую Охоту, когда Арденвельду грозит великая опасность. В час, когда лесное царство страдает от засухи анимы и нашествия врагов, лучшие охотники и охотницы готовы встать на его защиту.', 37474),
(2462, 'ruRU', 'Штопальщики', 'Штопальщики славятся своей способностью делать кадавров из плоти, анимы и костей. Эти мастера могут стать ценнейшими союзниками в Малдраксусе. Отколовшись от предательского дома Кадавров, они обосновались в разделочной Мясника.', 37474),
(2464, 'ruRU', 'Двор Ночи', 'Засуха анимы и вторжение друстов поглощают все внимание Королевы Зимы и Дикой Охоты, и дроман Двора Ночи делает все возможное, чтобы защитить дикие семена и рощи.', 37474);
