INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(1309, 'ruRU', 'Скрежещущий анимаклещ', '|cFFFFD200Приключения:|r Темные Земли|n', 'Эти исключительно ловкие летуны становятся прекрасными верховыми животными, если их удается отучить вытягивать всю аниму из своего наездника.', 37474),
(1420, 'ruRU', 'Темный рогач', '|cFFFFD200Торговец: |rВеретенос|n|cFFFFD200Зона: |rАрденвельд|n', 'Темные гормы самые безобидные из всех, но они также отращивают самые большие рога и жвалы. В этом и заключается секрет их спокойствия: другие существа стараются их не злить.', 37474),
(1414, 'ruRU', 'Кошмарная лошадь Савраска', '|cFFFFD200NPC:|r мертвая Савраска |n|cFFFFD200Зона:|r Ревендрет|n |n', 'При жизни Савраска казалась всем ласковой и хорошо воспитанной лошадью с чудесным характером и отменным аппетитом. Какое же зло она втайне совершила, что оказалась среди осужденных душ Ревендрета?', 37474),
(1291, 'ruRU', 'Везунчик Юнь', '|cFFFFD200Внутриигровой магазин|r|n', 'У пандаренов есть поверье: если потереть лапой блестящую шкуру быка, то вам обязательно улыбнется удача. Но такого быка не каждый догонит.', 37474),
(1424, 'ruRU', 'Снежная Буря', '|cFFFFD20030-летие Blizzard|r ', 'Он придет из снежной бури, белый мех среди лазури.', 37474);
INSERT INTO `lfg_dungeons_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2047, 'ruRU', 'Maldraxxus - Narrative Finale', '', 37474),
(2092, 'ruRU', 'Кровь из камня', 'Генералы Каменного легиона Денатрия ждут в засаде, готовые уничтожить мятежников и покончить с восстанием Ренатала.', 37474),
(2090, 'ruRU', 'Истощающие хранилища', 'Анима течет из хранилищ замка Нафрия, как кровь из открытой раны. Остановите это, пока Ревендрет не погиб.', 37474),
(2096, 'ruRU', 'Встреча с тщеславием', 'Денатрий ждет героев в своей башне, чтобы в последнем сражении решить судьбу Ревендрета.', 37474),
(2091, 'ruRU', 'Реликварий роскоши', 'Аристократы вовсю празднуют победу – это идеальный случай, чтобы остановить их потеху и покончить с их властью.', 37474),
(2070, 'ruRU', 'Смертельная тризна', '', 37474),
(2074, 'ruRU', 'Чертоги Покаяния', '', 37474),
(2069, 'ruRU', 'Чумные каскады', '', 37474),
