INSERT INTO `mail_template_locale` (`ID`, `locale`, `Body_lang`, `VerifiedBuild`) VALUES
(568, 'ruRU', '$p,\n\nне буду сомневаться в том, что ты действительно $gубил:убила; столько врагов, сколько $gнаписал:написала; в последнем письме.\n\nНо цифра подозрительно высокая. Впрочем, ты все-таки пилигрим Утробы...\n\nМне нравится это состязание и я стараюсь не отставать.\n\nЯ насчитала сто тридцать восемь смертельных выстрелов и ударов, и кроме того...\n\n<Корейн увлеклась и продолжила писать за пределами пергамента.>\n\nИтого сто пятьдесят два убитых противника! На последней охоте это были в том числе клещи, но ты меня так сильно опережаешь, что приходится считать всех!\n\nПопробуй набрать еще больше,\nкапитан-егерь Корейн', 37474);
INSERT INTO `chr_classes_locale` (`ID`, `locale`, `Name_lang`, `NameMale_lang`, `NameFemale_lang`, `Description_lang`, `RoleInfoString_lang`, `DisabledString_lang`, `HyphenatedNameMale_lang`, `HyphenatedNameFemale_lang`, `VerifiedBuild`) VALUES
(3, 'ruRU', 'Охотник', 'Охотник', 'Охотница', 'Дикая природа – родная стихия охотников, а животные для них – почти как братья. В бою они полагаются на оружие и помощь питомцев.', 'Роли: |cffffffffбоец дальнего или ближнего боя|r', 'Выберите другую расу для этого класса.', 'Охотник', 'Охотница', 37474),
(1, 'ruRU', 'Воин', 'Воин', 'Воин', 'Воины – бойцы в латных доспехах, стремящиеся достичь совершенства во владении оружием. Сражаясь, воин накапливает ярость, которую затем расходует на применение способностей.', 'Роли: |cffffffffтанк или боец ближнего боя|r', 'Выберите другую расу для этого класса.', 'Воин', 'Воин', 37474),
(11, 'ruRU', 'Друид', 'Друид', 'Друид', 'Друиды искусно меняют свой облик, принимая вид животных и растений. Они могут быть целителями, атаковать противника заклинаниями на расстоянии или, обернувшись кошкой или медведем, сражаться в ближнем бою.', 'Роли: |cffffffffтанк, лекарь, боец дальнего или ближнего боя|r', 'Выберите другую расу для этого класса.', 'Друид', 'Друид', 37474),
(5, 'ruRU', 'Жрец', 'Жрец', 'Жрица', 'Жрецы – прекрасные лекари с широким набором разнообразных целительных заклинаний. В то же время жрец может пожертвовать своей ролью целителя и посвятить себя изучению темной магии.', 'Роли: |cffffffffлекарь или боец дальнего боя|r', 'Выберите другую расу для этого класса.', 'Жрец', 'Жрица', 37474),
(8, 'ruRU', 'Маг', 'Маг', 'Маг', 'Маги – канонические волшебники Азерота. Долгими годами прилежной учебы они приобретают свои знания. Маги носят легкие доспехи, компенсируя уязвимость целым арсеналом атакующих и защитных заклинаний.', 'Роль: |cffffffffбоец дальнего боя|r', 'Выберите другую расу для этого класса.', 'Маг', 'Маг', 37474),
(7, 'ruRU', 'Шаман', 'Шаман', 'Шаманка', 'Шаманы обращаются к духам стихий, усиливая свое оружие и заклинания. В бою шаман использует тотемы, которые лечат союзников, выводят из строя противников и наносят им урон.', 'Роли: |cffffffffлекарь, боец дальнего или ближнего боя|r', 'Выберите другую расу для этого класса.', 'Шаман', 'Шаманка', 37474),
(12, 'ruRU', 'Охотник на демонов', 'Охотник на демонов', 'Охотница на демонов', 'Охотники на демонов принадлежат к героическому классу и начинают игру на высоком уровне. Они – темные изгнанники, которые используют запретную демоническую магию, чтобы преследовать и убивать своих врагов.', 'Роли: |cffffffffтанк или боец ближнего боя|r', 'Требуется дополнение Legion и наличие персонажа 70-го уровня.', 'Охотник на демонов', 'Охотница на демонов', 37474),
(9, 'ruRU', 'Чернокнижник', 'Чернокнижник', 'Чернокнижница', 'Чернокнижники пользуются магией огня и Тьмы, проклинают своих противников и вытягивают из них жизненные силы. Также они могут призывать демонов и управлять ими.', 'Роль: |cffffffffбоец дальнего боя|r', 'Выберите другую расу для этого класса.', 'Черно-|nкнижник', 'Черно-|nкнижница', 37474),
(4, 'ruRU', 'Разбойник', 'Разбойник', 'Разбойница', 'Разбойники часто служат наемными убийцами и лазутчиками, хотя есть среди них и убежденные одиночки. Разбойник может пробраться незамеченным среди врагов и не гнушается подкрасться к жертве сзади, чтобы прикончить ее наверняка.', 'Роль: |cffffffffбоец ближнего боя|r', 'Выберите другую расу для этого класса.', 'Разбойник', 'Разбойница', 37474);
